INSERT INTO publications (creator, team, role, goal, skill, description, posted_timestamp, is_active) VALUES
  (5, null, 'Композитор', 3, 100, 'Для акустического проекта ищу музыкантов единомышленников - гитариста,флейтиста(-ку),скрипача(-ку),перкуссиониста(желательно кахон),возможно и клавишника(-цу).Кто заинтересовался,пишите в личку.', to_timestamp(1449949800), FALSE),
  (3, null, 'Флейтистка', 2, 70, 'Ищу музыкантов-единомышленников для совместного творчества. Стили: gothic ethereal, indie, dream-pop, post-punk. По звучанию предполагается нечто немного напоминающее Fleur.
Мне 20, по образованию флейтистка, пишу песни (тексты на русском, музыку, аранжировки), материала много. 2,5 года пела и играла на ритм-гитаре в рок-группе (indie, garage).
В группу обязательно нужны: скрипка или альт (очень важна чистая интонация), гитара, бас, ударные.
Желательно найти: вторую вокалистку (умеющую попадать в ноты; сопрано или меццо-сопрано), перкуссиониста/ку. Не лишней будет виолончель или вторая скрипка.
А вообще, буду рада любым музыкантам, которых интересует такая музыка.
Требования: ответственность, заинтересованность, наличие своего инструмента и хорошее владение им; и главное - наличие сил, времени и ЖЕЛАНИЯ творить и развиваться в данном направлении.
Опыт желателен, но не обязателен. Пол и возраст не имеют значения. Приветствуется умение сочинять собственные партии, играть по ""цифровке"". При необходимости могу записать партии в нотах (например, для скрипки).
Предупреждаю сразу, проект некоммерческий. Но и не просто ""для души поиграть"". В дальнейшем хотелось бы участвовать в концертах и сделать студийную запись.', to_timestamp(1448049800), FALSE),
  (2, null, 'Сольный певец', 3, 65, 'Сольный певец ищет гитариста или группу для регулярных выступлений в Москве. Послушать материал http://vk.com/christian_lankgrin_public_pag', to_timestamp(1449049800), FALSE),
  (4, null, 'Барабанщик', 1, 33, 'Ребята, привет!
Я ищу музыкантов - гитариста и бас-гитариста, возможно, вокалиста тоже. Я играю на барабанах и сейчас мне нужно повысить свой уровень и попрактиковаться игре в группе. Если ты неплохо владеешь инструментом, хочешь совершенствоваться – пиши мне в личку. Я жду!', to_timestamp(1448964300), FALSE),
  (1, null, 'Музыкант-электронщик', 2, 50, 'Ищу музыканта в экспериментальный инди-проект

Ищу драммера или перкуссиониста имеющего возможность играть/записывать в подъезде по ночам.
район: Бирюлево-восточное
желательно наркомана, но и алкоголик тоже подойдет...
Демки пралагаются...

